import { Fragment } from "react";
import Drinks from "./components/Drinks/Drinks";
import Header from "./components/Layout/Header";

function App() {
  return (
    <Fragment>
      <Header />
      <Cart></Cart>
      <main>
        <Drinks />
      </main>
    </Fragment>
  );
}

export default App;
